import React,{Component} from 'react';
// import logo from './logo.svg';
import './App.css';
import Header from './Components/Header/Header';
import Division from './Components/Division/Division';

class App extends Component {

state = {
  people:[
    {name:"Shawn",fruit:"Pineapple"},
    {name:"Joe",fruit:"Watermelon"},
    {name:"Taylor",fruit:"Mango"},
    {name:"Valarie",fruit:"Peach"}
  ]


}

state1 = {
  article:[
    {title:"Day for Day",content:"Dieuson Octave Benjamin Diehl Ian Lewis"},
    {title:"Coolin and Booted",content:"Dieuson Octave Benjamin Diehl Ian Lewis"}
  ]
}

clickBtn = ()=>{
      console.log('test');

      this.setState(
        {
          people:[
            {name:"Double-E",fruit:"Pear"},
            {name:"Biggie",fruit:"Strawberry"},
            {name:"Tupac",fruit:"Lychee"},
            {name:"IceCube",fruit:"PassionFruit"}
          ]
        }
      );
}

render(){
  return (
    <div className="App">
   <h1>Woooohhoooooo</h1>


    <button className="btn" onClick={this.clickBtn}> Change Data</button>

   <Header name={this.state.people[0].name} fruit={this.state.people[3].fruit}/>
   <Header name={this.state.people[1].name} fruit={this.state.people[2].fruit}/>   
   <Header name={this.state.people[2].name} fruit={this.state.people[1].fruit}/>   
   <Header name={this.state.people[3].name} fruit={this.state.people[0].fruit}/>


    <Division/>
    <Division/>
    </div>
  );
}
}

export default App;
